def canCompleteCircuit(gas, cost): 
    sg = 0 # gas from the first index 0
    cg = 0 # current gas from possible start index
    res = -1 # result
    hasFalse = True # gas is not enough to continue
    for i in range(0, len(gas)):
        cg += gas[i] - cost[i]
        sg += gas[i] - cost[i]
        if sg < 0: 
            sg = 0
            hasFalse = True
            print('false i', i)
        elif hasFalse: 
            print('res i', i)
            res = i
            hasFalse = False
    if cg >= 0: 
        return res
    else:
        return -1

